import React from 'react';

const listData = [];
for (let i=0; i < 5; i++) {
  listData.push({
    index: i,
    name: "This is user: " + i,
    score: i * 10,
    game: 'poker'
  });
}

const Player = (props) => {
  const list = listData.map((item) => 
    <li key = { item.index } > Name: { item.name }, Score: { item.score }, Game: { item.game } </li>
  );
  
  return (
    <ul>
      {list}
    </ul>
  );
}

export default Player;
